import { Route, Routes } from "react-router-dom";
import SecondPage from "./SecondPage";
import ProductPageCategory from "./Product page category/ProductPageCategory";

const Mmnnnn = () => {
    return (
        <div>
            {/* <BrowserRouter> */}
            <Routes>
                <Route path='groceries' element={<SecondPage />} />
                <Route path='fashion' element={<SecondPage />} />
                <Route path='health-beauty' element={<SecondPage />} />
                <Route path='baby-products' element={<SecondPage />} />
                <Route path='phones-tablets' element={<SecondPage />} />

                <Route path="disposable-plates-cutlery" element={<ProductPageCategory />} />
                <Route path="disposable-cups" element={<ProductPageCategory />} />
                <Route path="trash-compost-lawn-bags" element={<ProductPageCategory />} />

                <Route path="detergent" element={<ProductPageCategory />} />
                <Route path="fabric-softner" element={<ProductPageCategory />} />
                <Route path="stain-removal" element={<ProductPageCategory />} />

                <Route path="air-fresheners" element={<ProductPageCategory />} />
                <Route path="food-storage" element={<ProductPageCategory />} />
                <Route path="Kitchen Cleaners" element={<ProductPageCategory />} />
                <Route path="Bathroom Cleaners" element={<ProductPageCategory />} />
            </Routes>
            {/* </BrowserRouter> */}
        </div>
    )
}
export default Mmnnnn;
